import React from 'react';
import Banner from './components/Banner';
import Exhibit from './components/Exhibit';

const App = () => {
  return (
    <div>
      <Banner />  
      <Exhibit title="Exhibit">
        <p>This is some content for the exhibit.</p>
      </Exhibit>
        
    </div>
  );
};

export default App;
